    m = [card[0] for card in cards]
    l = [sorted(card[1:]) for card in cards]
    for i in range(n):
        canWin = True
        for j in range(n):
            if not j == i:
                if m[i] < m[j]:
                    continue
                if contiene(l[j], l[i], m[j], m[i]):
                    canWin = True
                    break
        results.append('YES' if canWin else 'NO')
    return results
